        <div className="flex justify-center mt-10">
            <div className="w-full max-w-3xl">
                <form>
                    <div className="mb-4">
                        <label>Nombre</label>
                        <input
                        
                            className="shadow appearance-none border rounded w-full py-2 px-3"
                        />
                    </div>
                </form>

            </div>
        </div>
        </>
     );
}
 
export default NuevoPlatillo;
